class App extends Component{
state = {
   value:"odin"
};

onChange = e =>{

	this.setState({value:e.target.value})
}

render(){
	const {value} = this.state;
	return(

		<form>

			<label>
				Odin
				<input type="radio"
 				       value="odin"
				       onChange={this.onChange}/>

			</label>

			
			<label>
				thor
				<input type="radio"
 				       value="thor"
				       onChange={this.onChange}/>

			</label>
	
		</form>

)

}

}

export default App;
